import React, { useEffect, useState } from "react";
import axios from "axios";

export default function AdminDashboard() {
  const [schools, setSchools] = useState([]);
  const [players, setPlayers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState("");

  const token = localStorage.getItem("token");

  // Fetch schools and players on component mount
  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      setErr("");
      try {
        // Fetch schools
        const schoolResponse = await axios.get("http://localhost:5000/api/schools", {
          headers: { Authorization: `Bearer ${token}` },
        });
        console.log("Schools data received:", schoolResponse.data);

        if (schoolResponse.data.schools.length === 0) {
          setErr("No schools found.");
        } else {
          setSchools(schoolResponse.data.schools);
        }

        // Fetch players
        const playerResponse = await axios.get("http://localhost:5000/api/players", {
          headers: { Authorization: `Bearer ${token}` },
        });
        console.log("Players data received:", playerResponse.data);

        if (playerResponse.data.players.length === 0) {
          setErr("No players found.");
        } else {
          setPlayers(playerResponse.data.players);
        }
      } catch (error) {
        console.error("Error fetching data:", error);
        setErr("Error loading schools or players.");
      }
      setLoading(false);
    };

    fetchData();
  }, [token]);

  return (
    <div>
      <h1>Admin Dashboard</h1>
      {err && <div style={{ color: "red" }}>{err}</div>}
      {loading ? (
        <div>Loading...</div>
      ) : (
        <div>
          <h2>Schools</h2>
          <table border="1">
            <thead>
              <tr>
                <th>Name</th>
                <th>Address</th>
                <th>Email</th>
                <th>Phone</th>
              </tr>
            </thead>
            <tbody>
              {schools.map((school) => (
                <tr key={school.id}>
                  <td>{school.name}</td>
                  <td>{school.address}</td>
                  <td>{school.email}</td>
                  <td>{school.phone}</td>
                </tr>
              ))}
            </tbody>
          </table>

          <h2>Players</h2>
          <table border="1">
            <thead>
              <tr>
                <th>Name</th>
                <th>School</th>
                <th>DOB</th>
                <th>Phone</th>
              </tr>
            </thead>
            <tbody>
              {players.map((player) => (
                <tr key={player.id}>
                  <td>{player.full_name}</td>
                  <td>{player.school_name || player.school_id}</td>
                  <td>{player.dob}</td>
                  <td>{player.contact_no}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
